import { createBrowserRouter, RouterProvider } from 'react-router-dom';

// 数据加载函数
const userLoader = async () => {
  const response = await fetch('/api/user');
  if (!response.ok) {
    throw new Response('用户数据加载失败', { status: 500 });
  }
  return response.json();
};

// 创建路由配置
const router = createBrowserRouter([
  {
    path: '/',
    element: <Layout />,
    errorElement: <ErrorPage />,
    children: [
      {
        path: 'users/:id',
        element: <UserDetail />,
        loader: userLoader,
        errorElement: <UserError />
      }
    ]
  }
]);

// 应用入口
function App() {
  return <RouterProvider router={router} />;
}

// 在组件中使用数据
function UserDetail() {
  const user = useLoaderData();
  const navigation = useNavigation();
  
  return (
    <div>
      {navigation.state === 'loading' ? (
        <div>加载中...</div>
      ) : (
        <div>
          <h1>{user.name}</h1>
          <p>{user.email}</p>
        </div>
      )}
    </div>
  );
}`,language:"tsx",highlights:[1,4,9,10,18,24,29,33,36]}},{title:"路由器类型选择",component:r.jsx(S2,{}),description:"了解不同类型的Data Router及其适用场景",observationPoints:["createBrowserRouter是最常用的选择","createHashRouter适用于静态部署场景","createMemoryRouter主要用于测试","所有类型都支持完整的Data Router功能"],keyPoints:["选择合适的路由器类型很重要","BrowserRouter需要服务器支持","HashRouter无需服务器配置","MemoryRouter完全在内存中运行"],commonTraps:["在静态部署时使用BrowserRouter","不了解不同路由器的限制","测试时使用真实的路由器"],solutions:["根据部署环境选择合适的路由器","了解每种路由器的特点和限制","测试时使用MemoryRouter"],codeExample:{title:"不同路由器的创建方式",code:`// 1. Browser Router (推荐)
