function UserProfile() {
  const { userId } = useParams();
  const [user, setUser] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  
  useEffect(() => {
    fetchUser(userId)
      .then(setUser)
      .catch(setError)
      .finally(() => setLoading(false));
  }, [userId]);
  
  if (loading) return <Loading />;
  if (error) return <Error error={error} />;
  return <div>{user.name}</div>;
}

// Data Router 模式 - 路由级数据管理
export async function userLoader({ params }) {
  try {
    const user = await fetchUser(params.userId);
    return { user };
  } catch (error) {
    throw new Response("User not found", { status: 404 });
  }
}

function UserProfile() {
  const { user } = useLoaderData();
  return <div>{user.name}</div>;
}

// 路由配置对比
// 传统模式
<Routes>
  <Route path="/users/:userId" element={<UserProfile />} />
</Routes>

// Data Router 模式
const router = createBrowserRouter([
  {
    path: "/users/:userId",
    element: <UserProfile />,
    loader: userLoader,
    errorElement: <ErrorBoundary />,
  },
]);`,language:"typescript",highlights:[2,3,4,5,8,21,28,29,35,40,41,42,43]}},{title:"迁移策略规划",component:r.jsx(xP,{}),description:"展示从传统模式迁移到 Data Router 的详细步骤和策略",observationPoints:["迁移需要经过评估、规划、准备、试点、批量迁移、验证等阶段","每个阶段都有明确的任务、时间估算和风险评估","试点迁移是降低风险的关键步骤","需要充分的测试和验证确保迁移成功"],keyPoints:["制定详细的迁移计划和时间表","选择合适的迁移策略（渐进式 vs 一次性）","建立完善的测试和回滚机制","投资团队培训和知识转移"],commonTraps:["低估迁移的复杂度和风险","没有充分的测试和验证","缺乏回滚策略和应急预案"],solutions:["分阶段进行，降低单次迁移风险","建立完善的测试体系","准备详细的回滚计划"],codeExample:{title:"渐进式迁移示例",code:`// 第一阶段：创建混合路由配置
