import { useNavigation } from 'react-router-dom';

function Layout() {
  const navigation = useNavigation();
  const isLoading = navigation.state === 'loading';
  
  return (
    <div>
      <nav>
        {/* 导航菜单 */}
      </nav>
      
      {isLoading && (
        <div className="fixed top-0 left-0 w-full h-1 bg-blue-500 animate-pulse" />
      )}
      
      <main className={isLoading ? 'opacity-50' : ''}>
        <Outlet />
      </main>
    </div>
  );
}

// 在组件中处理加载状态
function UserProfile() {
  const data = useLoaderData() as { user: User };
  const navigation = useNavigation();
  
  // 处理表单提交状态
  const isSubmitting = navigation.state === 'submitting';
  
  return (
    <div>
      <h1>{data.user.name}</h1>
      <form method="post">
        <input name="name" defaultValue={data.user.name} />
        <button disabled={isSubmitting}>
          {isSubmitting ? '保存中...' : '保存'}
        </button>
      </form>
    </div>
  );
}`,tips:["使用 useNavigation 钩子获取全局导航状态","可以显示顶部进度条或页面遮罩","区分不同的加载状态：loading、submitting、idle","考虑为长时间加载提供取消功能"]},seo:{title:"SEO 优化",problem:"单页应用的 SEO 优化和元数据管理",solution:`// 使用 React Helmet 管理页面元数据
